import React, { Component } from 'react';
import {Route, Switch} from 'react-router-dom'
import seedColors from './seedColors'
import ColorPalette from './ColorPalette'
import ColorPaletteList from './ColorPaletteList'
import './App.css';

class App extends Component {
  static defaultProps = {
    colorPalettes: seedColors
}
  render(){


    return (
      <div className="App">
        {/* <ColorPalette /> */}
        {/* <ColorPaletteList /> */}
        <Switch>
          <Route exact path="/palettes" render = {() => <ColorPaletteList colorPalettes={this.props.colorPalettes} />} />
          <Route exact path = "/palettes/:name" component = {ColorPalette} />
        </Switch>

      </div>
    );
  }

}

export default App;
